import{_ as t,c as l,o as i,a5 as e}from"./chunks/framework.-E9IboRH.js";const x=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"汇总面试题/网络/2. HTTP协议/什么是http状态码？🔥.md","filePath":"汇总面试题/网络/2. HTTP协议/什么是http状态码？🔥.md"}'),o={name:"汇总面试题/网络/2. HTTP协议/什么是http状态码？🔥.md"},n=e("<p>HTTP 状态码是由服务器端返回给客户端的一个三位数字，用于表示服务器对请求的处理结果。它是 HTTP 协议中的一部分，提供了关于请求的成功、失败、重定向等信息。状态码由三位数字组成，第一个数字定义了状态码的类别，后两个数字没有分类的作用。常见的 HTTP 状态码有以下几类：</p><ol><li><p><strong>1xx（信息性状态码）：</strong> 服务器收到请求，需要请求者继续执行操作。</p><ul><li>100 Continue：请求者应继续发送请求。服务器返回此代码表示已收到请求的第一部分，正在等待其余部分。</li></ul></li><li><p><strong>2xx（成功状态码）：</strong> 请求被成功接收、理解、接受或处理。</p><ul><li>200 OK：请求成功。一般用于 GET、POST 请求。</li><li>201 Created：请求已经被实现，并且创建了新的资源。</li><li>204 No Content：服务器成功处理了请求，但没有返回任何内容。</li></ul></li><li><p><strong>3xx（重定向状态码）：</strong> 需要客户端采取进一步的操作才能完成请求。</p><ul><li>301 Moved Permanently：请求的资源已被永久移动到新的 URI。</li><li>302 Found：请求的资源现在临时从不同的 URI 响应请求。</li></ul></li><li><p><strong>4xx（客户端错误状态码）：</strong> 客户端出现错误，请求包含语法错误或者无法完成请求。</p><ul><li>400 Bad Request：请求无效，服务器不理解请求的语法。</li><li>401 Unauthorized：请求要求身份验证。</li><li>403 Forbidden：服务器理解请求，但拒绝执行。</li></ul></li><li><p><strong>5xx（服务器错误状态码）：</strong> 服务器在处理请求的过程中发生了错误。</p><ul><li>500 Internal Server Error：服务器遇到了一个未曾预料的状况，导致了它无法完成对请求的处理。</li><li>502 Bad Gateway：服务器作为网关或者代理，从上游服务器收到无效的响应。</li></ul></li></ol><p>这些状态码帮助客户端了解请求的处理结果，让用户或开发者能够更好地理解发生了什么问题。在 Web 开发中，通过检查 HTTP 状态码，可以更好地调试和处理请求。</p>",3),r=[n];function _(a,s,p,T,d,c){return i(),l("div",null,r)}const P=t(o,[["render",_]]);export{x as __pageData,P as default};
